import { Component } from "react";
import Button from "react-bootstrap/Button";
import Modal from "react-bootstrap/Modal";

export class ModalError extends Component {
  state = {
    closeBtn: false,
  };

  clickClose = () => {
    this.setState({ closeBtn: true });
  };
  render() {
    return (
      <div className="modal show" style={{ display: "block", position: "initial" }}>
        <Modal.Dialog>
          <Modal.Header closeButton>
            <Modal.Title></Modal.Title>
          </Modal.Header>

          <Modal.Body>
            <p>Введи более корректное имя покемона, а то успех будет явно не у тебя</p>
          </Modal.Body>

          <Modal.Footer>
            <Button variant="secondary" onClick={this.clickClose}>
              Close
            </Button>
          </Modal.Footer>
        </Modal.Dialog>
      </div>
    );
  }
}
